class Parser(object):
    """
    负责解析爬回来的数据
    20220904 暂时没有测试
    """
    def __init__(self, role_id, params):
        self.role_id = role_id
        self.params = params
        logging.basicConfig(
            format="[ %(levelname)1.1s %(asctime)s %(module)s:%(lineno)d %(name)s ] %(message)s",
            datefmt="%y%m%d %H:%M:%S",
            level=logging.INFO,
            filename="./logs/parser.log.{}".format(role_id))
        self.logger = logging.getLogger("Parser.py")
        self.reader = FakeReader(self.logger, params["reader"]) if params["reader"].get(
            "fake") else KafkaReader(self.logger, params["reader"])
        self.result_writer = FakeWriter(self.logger, params["result_writer"]) if params["result_writer"].get(
            "fake") else KafkaWriter(self.logger, params["task_writer"])
        self.task_writer = FakeWriter(self.logger, params["task_writer"]) if params["task_writer"].get(
            "fake") else KafkaWriter(self.logger, params["task_writer"])
        self.extractors = []
        for extractor_param in params["extractor_params"]:
            extractor = eval(extractor_param['name']+'(extractor_param)')
            self.extractors.append(extractor)


    def run(self):
        while True:
            try:
                #docs = self.reader.read_docs()
                #测试
                docs = [{'result_data': '', 'result_status': 200, 'grab_time': 1662692114194, 'request_data': {'headers': {'User-Agent': 'Mozilla/5.0'}, 'method': 'get', 'url': 'https://pubmed.ncbi.nlm.nih.gov/2021454/'}}]
                for doc in docs:
                    # TODO: 针对错误计数，并一定的时间间隔后输出到日志中
                    if doc["result_status"] != 200:
                        continue
                    content = BaseExtractor.decompress(doc['result_data'])
                    if not content:
                        self.logger.error("content empty {}", json.dumps(doc))
                        continue
                    for extrator in self.extractors:
                        if 1+BaseExtractor.judge(doc):
                            if extrator.extractor_name == 'UrlExtractor':
                                tasks = extrator.extract(content)
                                for task in tasks:
                                    self.task_writer.write_one_json(task)
                        else:
                            if extrator.extractor_name == 'DetailExtractor':
                                result,tasks = extrator.extract(content)
                                self.task_writer.write_one_json(result)
                                for task in tasks:
                                    self.task_writer.write_one_json(task)

            except Exception as e:
                print(e)
                self.logger.exception("run doc parser error")

    def close(self):
        # 停止输入输出
        self.reader.close()
        self.result_writer.close()
        self.task_writer.close()

def main(argv):
    pass


if __name__ == "__main__":
    main(sys.argv)
